import React, { useState } from "react";
import styled from "styled-components";

const PageContainer = styled.div`
    display: flex;
    min-height: 100vh;
    width: 100vw; /* Full viewport width */
    background: linear-gradient(135deg, #667eea, #764ba2);
    padding: 20px; /* Adjust padding for more space */
    box-sizing: border-box;
    margin-top: 40px; /* Move the content down by 50px (adjust as needed) */
`;

const Sidebar = styled.div`
    width: 25%; /* Adjust width to fit full screen layout */
    background: #fff;
    border-radius: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    padding: 20px;
    margin-right: 20px; /* Reduced margin for a compact layout */
    box-sizing: border-box; /* Ensure padding is included in width */
    position: relative; /* Needed for dropdown positioning */
`;

const Content = styled.div`
    flex: 1;
    background: #f7f7f7;
    border-radius: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    padding: 20px;
    box-sizing: border-box; /* Ensure padding is included in width */
`;

const Section = styled.div`
    margin-bottom: 20px; /* Adjust margin for better spacing */
`;

const Title = styled.h2`
    color: #333;
    font-family: 'Montserrat', sans-serif;
    margin-bottom: 15px; /* Adjust margin for better spacing */
    font-size: 22px; /* Slightly smaller title size */
    text-align: left;
`;

const Button = styled.button`
    background: #667eea;
    border: none;
    border-radius: 50px;
    color: white;
    padding: 10px 20px; /* Adjust padding for consistency */
    cursor: pointer;
    font-size: 16px;
    font-weight: bold;
    margin-top: 10px;
    transition: background 0.3s ease;

    &:hover {
        background: #5a67d8;
    }
`;

const Input = styled.input`
    width: 100%;
    padding: 10px 15px; /* Adjust padding for consistency */
    margin: 8px 0;
    border: 1px solid #ccc;
    border-radius: 10px;
    box-sizing: border-box;
`;

const ProfileContainer = styled.div`
    display: flex;
    align-items: center;
    position: relative;
`;

const ProfileImage = styled.img`
    width: 50px;
    height: 50px;
    border-radius: 50%;
    cursor: pointer;
    border: 2px solid #fff;
    box-shadow: 0 0 5px rgba(0, 0, 0, 0.3);
`;

const Dropdown = styled.div`
    position: absolute;
    top: 60px;
    right: 0;
    background: #fff;
    border-radius: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    width: 200px;
    display: ${props => (props.isOpen ? 'block' : 'none')};
    padding: 10px;
    z-index: 10;
`;

const DropdownItem = styled.div`
    margin: 5px 0;
    font-size: 16px;
    color: #333;
`;

function UploadPage() {
    const [isDropdownOpen, setIsDropdownOpen] = useState(false);

    const toggleDropdown = () => setIsDropdownOpen(!isDropdownOpen);

    return (
        <PageContainer>
            <Sidebar>
                <ProfileContainer>
                    <ProfileImage 
                        src="https://via.placeholder.com/50" /* Replace with your profile image URL */
                        alt="Profile"
                        onClick={toggleDropdown}
                    />
                    <Dropdown isOpen={isDropdownOpen}>
                        <DropdownItem>Name: John Doe</DropdownItem> {/* Replace with dynamic name */}
                        <DropdownItem>Email: john.doe@example.com</DropdownItem> {/* Replace with dynamic email */}
                    </Dropdown>
                </ProfileContainer>
                <Section>
                    <Title>Previous Reports</Title>
                    {/* Add previous reports elements here */}
                </Section>
                <Section>
                    <Title>Previous Submissions</Title>
                    {/* Add previous submissions elements here */}
                </Section>
                <Section>
                    <Title>Submit GitHub Repository</Title>
                    <Input type="text" placeholder="Enter GitHub URL" />
                    <Button>Submit</Button>
                </Section>
            </Sidebar>
            <Content>
                <Section>
                    <Title>Report Resolve</Title>
                    {/* Add report resolution details here */}
                </Section>
                <Section>
                    <Title>Current Projects</Title>
                    {/* Add current projects details here */}
                </Section>
                <Section>
                    <Title>Upload APK File</Title>
                    <Input type="file" />
                    <Button>Upload & Analyze</Button>
                </Section>
                <Section>
                    <Title>Vulnerabilities Analysis</Title>
                    <ul>
                        <li>Static Analysis</li>
                        <li>Configuration Analysis</li>
                        <li>External Dependencies</li>
                    </ul>
                </Section>
            </Content>
        </PageContainer>
    );
}

export default UploadPage;
